import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
import Header from './Header';
import history from './history';

class PageReponse extends Component {


    constructor(props) {
        super(props);
        this.handleClick = this.handleClick.bind(this);
    }

    handleClick(event)  {
        history.goBack();
        fetch("http://localhost:8080/Web-Project/project/UpdateQuestion", {
            method: "put",
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                question: "myName",
                reponse: "myPassword",
                isTraite: "true"
            })
        })
    }
    render() {
      return (
        <div className="Reponse">
            <Header />
            <h2 className="reponse-title"> Reponse </h2>
            <div className="reponse-textfield">
                <textarea rows="20" cols="100">
                </textarea>
                <hr className="separate-demandes"></hr>
                <Button className="envoyer-response" variant="contained" color="default" onClick={(e) => this.handleClick(e)}>Envoyer</Button>
            </div>
        </div>
      );
    }

  }


export default PageReponse;
